//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/security/Pausable.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";

contract Whitelist {
    struct Slot {
        address wallet;
        uint individualMaximumAmount;
    }

    mapping(address => uint) private  _whitelist;
    Slot[] private _slots;
    uint[] private _emptyPosition;
    uint public individualMinimumAmount;

    constructor(uint _individualMinimumAmount) {
        individualMinimumAmount = _individualMinimumAmount;
    }

    event AddToWhitelistEvent(address wallet, uint maximumAmount);
    event RemoveFromWhitelistEvent(address wallet);

    modifier onlyWhitelisted(address wallet) {
        require(isWhitelisted(wallet), "Address has not been in whitelist");
        _;
    }

    function isWhitelisted(address wallet) public view returns(bool) {
        return _whitelist[wallet] == 0 ? false : true;
    }

    function getIndividualMaximumAmount(address wallet) public view returns(uint) {
        if (_whitelist[wallet] == 0) return 0;
        return _slots[_whitelist[wallet] - 1].individualMaximumAmount;
    }

    function whitelist() public view returns(address[] memory) {
        address[] memory res = new address[](_slots.length);
        for(uint i = 0; i < _slots.length; i++)
            res[i] = _slots[i].wallet;
        return res;
    }

    function add(address wallet, uint amount) internal {
        require(!isWhitelisted(wallet), "Address has already been in whitelist");
        require(amount >= individualMinimumAmount, "MaxAmount must be > minAmount");
        Slot memory newSlot = Slot(wallet, amount);
        if (_emptyPosition.length != 0) {
            uint index = _emptyPosition[_emptyPosition.length - 1];
            _slots[index] = newSlot;
            _emptyPosition.pop();
            _whitelist[wallet] = index + 1;
        }
        else {
            _slots.push(newSlot);
            _whitelist[wallet] = _slots.length;
        }
        emit AddToWhitelistEvent(wallet, amount);
    }

    function add(address[] calldata wallets, uint[] calldata amounts) internal {
        for(uint i = 0; i < wallets.length; i++)
            require(!isWhitelisted(wallets[i]), "One address has already been in whitelist");
        for(uint i = 0; i < wallets.length; i++)
            require(amounts[i] >= individualMinimumAmount, "MaxAmount must be > minAmount");
        for(uint i = 0; i < wallets.length; i++) {
            add(wallets[i], amounts[i]);
        }
    }

    function remove(address wallet) internal onlyWhitelisted(wallet) {
        uint index = _whitelist[wallet] - 1;
        delete _slots[index];
        _whitelist[wallet] = 0;
        _emptyPosition.push(index);
        emit RemoveFromWhitelistEvent(wallet);
    }
}

contract Pool is Whitelist, Ownable, Pausable {
    using SafeMath for uint;
    struct Purchase {
        uint amount;
        address purchaser;
        uint timestamp;
        uint ethAmount;
        bool wasFinalized;
        bool wasFailed;
    }

    uint private _nextPurchaseId = 1;
    mapping(uint => Purchase) private _purchases;
    mapping(address => uint[]) private _myPurchases;
    ERC20 public erc20;
    bool public isSaleFunded = false;
    uint8 public decimals;
    bool public isUnsoldTokensRedeemed = false;
    uint public tradeRatio;
    uint public startDate;
    uint public endDate;
    uint public tokensAllocated = 0;
    uint public tokensForSale;
    address private FEE_ADDRESS;
    uint8 public feePercentage = 1;
    address public signer;

    event ChangeInformationEvent(string attribute, address value, address signer);
    event ChangeInformationEvent(string attribute, uint value, address signer);
    event PurchaseEvent(address purchaser, uint tokensAmount, uint timestamp);

    modifier inChangeableTime() {
        require(block.timestamp < startDate - 7 * 24 * 60 * 60, "Can only change information before at least 7 days until startDate");
        _;
    }

    modifier onlySigner() {
        require(msg.sender == signer, "Must be signer to do this");
        _;
    }

    /**
    Check function only work when Sale hasn't been started
    */
    modifier isSalePreStarted() {
        require(isPreStart(), "Has to be pre-started");
        _;
    }

    modifier isSaleOpen() {
        require(isOpen(), "Has to be opened");
        _;
    }

    modifier isSaleFinalized() {
        require(hasFinalized(), "Pool has not finalized yet");
        _;
    }

    modifier isPurchaseExist(uint purchaseId) {
        require(purchaseId > 0, "Id must be > 0");
        require(purchaseId < _nextPurchaseId, "Purchase not found");
        _;
    }

    modifier isBuyer(uint purchaseId) {
        require(_purchases[purchaseId].purchaser == msg.sender, "Wallet must be purchaser of this purchase");
        _;
    }

    modifier onlyPurchaseNotHandled(uint purchaseId) {
        require(!isPurchaseHandled(purchaseId), "Purchase has been handled");
        _;
    }

    constructor(address tokenAddress, uint tokensforsale, uint tokenvalue, uint startTimestamp, uint endTimestamp, uint minimumAmount, address onwer, address feeTaker, uint8 feeAmount) Whitelist(minimumAmount) Ownable() Pausable() {
        require(tokensforsale > 0, "TokensForSale must be greater than zero");
        require(tokenvalue > 0, "tokenValue must be greater than zero");
        require(startTimestamp > block.timestamp, "startDate must be in the future");
        require(endTimestamp > startTimestamp, "endDate must greater than startDate");
        require(minimumAmount < tokensforsale, "MinimumAmount must be smaller than tokens for sale");
        require(feeAmount >= feePercentage, "FeePercentage must be greater than 0");
        require(feeAmount < 100, "FeePercentage must be smaller than 100");

        erc20 = ERC20(tokenAddress);
        decimals = erc20.decimals();
        tradeRatio = tokenvalue;
        startDate = startTimestamp;
        endDate = endTimestamp;
        tokensForSale = tokensforsale;
        FEE_ADDRESS = feeTaker;
        feePercentage = feeAmount;
        super.transferOwnership(onwer);
        signer = msg.sender;
    }

    function getInformation() external view returns(address, uint8, uint, uint, uint, uint, uint, uint) {
        return (
            address(erc20),
            decimals,
            tradeRatio,
            startDate,
            endDate,
            tokensAllocated,
            tokensForSale,
            getCostFromTokens(tokensForSale)
        );
    }

    function setErc20(address tokenAddress) external onlyOwner inChangeableTime {
        erc20 = ERC20(tokenAddress);
        decimals = erc20.decimals();
        emit ChangeInformationEvent("ERC20", tokenAddress, msg.sender);
    }

    function setTokenValue(uint tradeValue) external onlyOwner inChangeableTime {
        require(tradeValue > 0, "tokenValue must be greater than zero");
        tradeRatio = tradeValue;
        emit ChangeInformationEvent("TokenValue", tradeValue, msg.sender);
    }

    function setStartDate(uint _startdate) external onlyOwner inChangeableTime {
        require(_startdate > block.timestamp, "startDate must be in the future");
        require(_startdate < endDate, "startDate must be smaller than endDate");
        startDate = _startdate;
        emit ChangeInformationEvent("StartDate", _startdate, msg.sender);
    }

    function setEndDate(uint _enddate) external onlyOwner inChangeableTime {
        require(_enddate > startDate, "endDate must greater than startDate");
        endDate = _enddate;
        emit ChangeInformationEvent("EndDate", _enddate, msg.sender);
    }

    function setTokensForSale(uint _tokensforsale) external onlyOwner inChangeableTime {
        require(_tokensforsale > 0, "TokensForSale must be greater than zero");
        tokensForSale = _tokensforsale;
        emit ChangeInformationEvent("TokensForSale", _tokensforsale, msg.sender);
    }

    function isPreStart() public view returns(bool) {
        return block.timestamp < startDate;
    }

    function isOpen() public view returns(bool) {
        return !isPreStart() && !hasFinalized();
    }

    function hasFinalized() public view returns(bool) {
        return block.timestamp > endDate;
    }

    function isPurchaseHandled(uint id) internal view returns(bool) {
        Purchase storage purchase = _purchases[id];
        return (purchase.wasFinalized || purchase.wasFailed);
    }

    function fund(uint amount) external onlyOwner isSalePreStarted {
        require(erc20.balanceOf(address(this)) + amount <= tokensForSale, "TokenAmount is more than enough");
        require(erc20.transferFrom(msg.sender, address(this), amount), "Something went wrong when changing tokens from owner to pool");
        if (erc20.balanceOf(address(this)) == tokensForSale) {
            isSaleFunded = true;
        }
    }

    function changeSigner(address newSigner) external onlySigner isSalePreStarted {
        signer = newSigner;
    }

    function addToWhitelist(address[] calldata wallets, uint[] calldata amounts) external onlySigner isSalePreStarted {
        for(uint i = 0; i < wallets.length; i++) {
            require(amounts[i] <= tokensForSale, "IndividualMaximumAmount must smaller than tokensForSale");
        }
        Whitelist.add(wallets, amounts);
    }
    
    function addToWhitelist(address wallet, uint amount) external onlySigner isSalePreStarted {
        require(amount <= tokensForSale, "IndividualMaximumAmount must smaller than tokensForSale");
        Whitelist.add(wallet, amount);
    }
    
    function removeFromWhitelist(address wallet) external onlySigner isSalePreStarted {
        Whitelist.remove(wallet);
    }

    function pauseContract() external onlyOwner isSaleOpen {
        Pausable._pause();
    }

    function unpauseContract() external onlyOwner isSaleOpen {
        Pausable._unpause();
    }

    function tokensLeft() public view returns(uint) {
        return tokensForSale - tokensAllocated;
    }

    function getCostFromTokens(uint amount) public view returns(uint) {
        require(amount > 0, "TokenAmount must be > 0");
        return amount.mul(tradeRatio).div(10 **decimals);
    }

    function swap(uint amount) external isSaleOpen onlyWhitelisted(msg.sender) whenNotPaused payable {
        require(isSaleFunded, "Has to be funded");
        require(amount > 0, "SwapAmount must be > 0");
        uint individualMaximumAmount = Whitelist.getIndividualMaximumAmount(msg.sender);
        uint hasSwappedAmount = getTotalSwappedTokensAmount(msg.sender);
        require(hasSwappedAmount.add(amount) >= individualMinimumAmount, "Swap amount must at least individualMinimumAmount");
        require(hasSwappedAmount.add(amount) <= individualMaximumAmount, "Swap amount has over individualMaximumAmount");
        require(amount <= tokensLeft(), "Swap amount has over the rest");
        require(msg.value >= getCostFromTokens(amount), "Please send enough fund to swap");

        Purchase memory newPurchase = Purchase(amount, msg.sender, block.timestamp, msg.value, false, false);
        _purchases[_nextPurchaseId] = newPurchase;
        _myPurchases[msg.sender].push(_nextPurchaseId);
        tokensAllocated = tokensAllocated.add(amount);
        _nextPurchaseId = _nextPurchaseId.add(1);
        emit PurchaseEvent(newPurchase.purchaser, newPurchase.amount, newPurchase.timestamp);
    }

    function getTotalSwappedTokensAmount(address wallet) internal onlyWhitelisted(wallet) view returns(uint) {
        uint[] storage listPurchase = _myPurchases[wallet];
        uint sum = 0;
        for(uint i = 0; i < listPurchase.length; i++) {
            Purchase storage purchase = _purchases[listPurchase[i]];
            sum = sum.add(purchase.amount);
        }
        return sum;
    }

    function getPurchase(uint id) external isPurchaseExist(id) view returns(uint, address, uint, uint, bool, bool) {
        Purchase storage purchase = _purchases[id];
        return (purchase.amount, purchase.purchaser, purchase.ethAmount, purchase.timestamp, purchase.wasFinalized, purchase.wasFailed);
    }

    function getMyPurchases() external view returns(uint[] memory) {
        return _myPurchases[msg.sender];
    }

    function redeemTokens(uint purchaseId) external isSaleFinalized whenNotPaused onlyWhitelisted(msg.sender) isPurchaseExist(purchaseId) isBuyer(purchaseId) onlyPurchaseNotHandled(purchaseId) {
        _purchases[purchaseId].wasFinalized = true;
        require(erc20.transfer(msg.sender, _purchases[purchaseId].amount), "ERC20 worked failed");
    } 
    
    function redeemTokens() external isSaleFinalized whenNotPaused onlyWhitelisted(msg.sender) {
        uint[] storage listPurchases = _myPurchases[msg.sender];
        for(uint i = 0; i < listPurchases.length; i++) {
            if(!isPurchaseHandled(listPurchases[i])) {
                _purchases[listPurchases[i]].wasFinalized = true;
                require(erc20.transfer(msg.sender, _purchases[listPurchases[i]].amount), "ERC20 worked failed");
            }
        }
    } 
    
    function redeemFunds(uint purchaseId) external isSaleFinalized whenPaused onlyWhitelisted(msg.sender) isPurchaseExist(purchaseId) isBuyer(purchaseId) onlyPurchaseNotHandled(purchaseId) {
        _purchases[purchaseId].wasFailed = true;
        payable(msg.sender).transfer(_purchases[purchaseId].ethAmount);
    } 
    
    function redeemFunds() external isSaleFinalized whenPaused onlyWhitelisted(msg.sender) {
        uint[] storage listPurchases = _myPurchases[msg.sender];
        for(uint i = 0; i < listPurchases.length; i++) {
            if(!isPurchaseHandled(listPurchases[i])) {
                _purchases[listPurchases[i]].wasFailed = true;
                payable(msg.sender).transfer(_purchases[listPurchases[i]].ethAmount);
            }
        }
    } 
    
    function withdrawUnsoldTokens() external onlyOwner isSaleFinalized {
        require(!isUnsoldTokensRedeemed, "Owner has already withdrawed unsold tokens");
        isUnsoldTokensRedeemed = true;
        require(erc20.transfer(msg.sender, tokensLeft()), "ERC20 worked failed");
    }

    function withdrawFunds() external onlyOwner isSaleFinalized whenNotPaused {
        payable(FEE_ADDRESS).transfer(address(this).balance.mul(feePercentage).div(100));
        payable(msg.sender).transfer(address(this).balance);
    }
}
